<template>
  <div class="event-card"></div>
</template>

<script>
// @ is an alias to /src
import EventService from '@/services/EventService.js'

export default {
  data() {
    return {
      id: 123,
      event: null,
    }
  },
  created() {
    EventService.getEvent(this.id)
      .then((response) => {
        this.event = response.data
      })
      .catch((error) => {
        console.log(error)
      })
  },
}
</script>

<style scoped>
.events {
  display: flex;
  flex-direction: column;
  align-items: center;
}
</style>
